import React from 'react';
import Modal from 'react-modal';

const ModalScreen = (props) => (
     <Modal
    //  isOpen = {}
     contentLabel="Processing"
    //  onRequestClose={}
     closeTimeoutMS={600}
     className="modal"
     >
        <h3>Processing...</h3>
        <a href="javascript:void(0);" onClick={() => this.closeModal()}>Close</a>

     </Modal>
 );


export default ModalScreen;
